SELECT item.i_item_id, customer_address.ca_country, customer_address.ca_state, customer_address.ca_county, AVG(CAST(catalog_sales.cs_quantity AS DECIMAL(12, 2))) AS agg1, AVG(CAST(catalog_sales.cs_list_price AS DECIMAL(12, 2))) AS agg2, AVG(CAST(catalog_sales.cs_coupon_amt AS DECIMAL(12, 2))) AS agg3, AVG(CAST(catalog_sales.cs_sales_price AS DECIMAL(12, 2))) AS agg4, AVG(CAST(catalog_sales.cs_net_profit AS DECIMAL(12, 2))) AS agg5, AVG(CAST(customer.c_birth_year AS DECIMAL(12, 2))) AS agg6, AVG(CAST(customer_demographics.cd_dep_count AS DECIMAL(12, 2))) AS agg7 FROM catalog_sales, customer_demographics, customer_demographics AS customer_demographics0, customer, customer_address, date_dim, item WHERE catalog_sales.cs_sold_date_sk = date_dim.d_date_sk AND catalog_sales.cs_item_sk = item.i_item_sk AND (catalog_sales.cs_bill_cdemo_sk = customer_demographics.cd_demo_sk AND (catalog_sales.cs_bill_customer_sk = customer.c_customer_sk AND customer_demographics.cd_gender = 'F')) AND (customer_demographics.cd_education_status = 'Primary' AND (customer.c_current_cdemo_sk = customer_demographics0.cd_demo_sk AND customer.c_current_addr_sk = customer_address.ca_address_sk) AND ((customer.c_birth_month = 1 OR (customer.c_birth_month = 3 OR customer.c_birth_month = 7) OR (customer.c_birth_month = 11 OR (customer.c_birth_month = 10 OR customer.c_birth_month = 4))) AND (date_dim.d_year = 2001 AND (customer_address.ca_state = 'AL' OR (customer_address.ca_state = 'MO' OR customer_address.ca_state = 'TN') OR (customer_address.ca_state = 'GA' OR customer_address.ca_state = 'MT' OR (customer_address.ca_state = 'IN' OR customer_address.ca_state = 'CA')))))) GROUP BY ROLLUP(item.i_item_id, customer_address.ca_country, customer_address.ca_state, customer_address.ca_county) ORDER BY customer_address.ca_country, customer_address.ca_state, customer_address.ca_county, item.i_item_id LIMIT 100